import React from 'react'

function Posts(props){
    const {posts} = props
    console.log(`${props}`)
    if (!posts || posts.length === 0) return <p>No Posts Found</p>
    return(
        <div>
            {posts.map(post => {
                <h1>{post.title}</h1>
            })}
        </div>
    )
}

export default Posts
